import { StyleSheet } from "react-native";

const style = StyleSheet.create({
    header: {
        display: 'flex',
        flexDirection: 'row',
        alignItems: 'center',
        paddingTop: 70,
        paddingLeft: 35,
        paddingBottom: 17.5
    },
    headerText: {
        fontFamily: 'LexendGiga_800ExtraBold',
        fontSize: 16,
        lineHeight: 20,
        paddingLeft: 12,
        color: '#4E4E4E'
    }
});

export default style;
